    Counts the number of ways to make change for 'n' cents using the given coin denominations.

    Parameters:
    n (int): The total amount for which we need to make change.
    coins (list): A list of coin denominations available.

    Returns:
    int: The number of ways to make change for 'n' cents.
    """

    def count(x, m, n):
        if n == 0:
            return 1
        if n < 0:
            return 0
        if m <= 0 and n >= 1:
            return 0
        return count(x, m - 1, n) + count(x, m, n + x[m - 1])
    return count(coins, len(coins), n)

